<!DOCTYPE html>
<html lang="en">

<head>
   <meta charset="UTF-8">
   <meta name="viewport" content="width=device-width, initial-scale=1.0">
   <title>ElectionMap.lol :: (Legacy) House</title>
   <link rel="stylesheet" href="./style.css">
   <link rel="preconnect" href="https://fonts.googleapis.com">
   <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
   <link href="https://fonts.googleapis.com/css2?family=Josefin+Sans:ital,wght@0,100..700;1,100..700&display=swap"
      rel="stylesheet">
   <script src="https://cdnjs.cloudflare.com/ajax/libs/PapaParse/5.3.0/papaparse.min.js"></script>
</head>

<body class="stripe">

   <!-- When you hover over a state this appears-->
   <div class="StateInfo">
      <p id="details-box"></p>
   </div>

   <div class="container">

      <div class="box titlebox">
            <h1 class="title">ElectionMap.lol</h1>
      </div>

      <div class="box resultbarbox">
         <div class="resultbar">
            <div class="color-segment" style="width: 10%;">&nbsp;</div>
            <div class="color-segment" style="width: 15%;">&nbsp;</div>
            <div class="color-segment" style="width: 5%;">&nbsp;</div>
            <div class="color-segment" style="width: 20%;">&nbsp;</div>
            <div class="color-segment" style="width: 10%;">&nbsp;</div>
            <div class="color-segment" style="width: 5%;">&nbsp;</div>
            <div class="color-segment" style="width: 10%;">&nbsp;</div>
            <div class="color-segment" style="width: 5%;">&nbsp;</div>
            <div class="color-segment" style="width: 15%;">&nbsp;</div>
            <div class="color-segment" style="width: 5%;">&nbsp;</div>
            <div class="color-segment" style="width: 15%;">&nbsp;</div>
            <div class="color-segment" style="width: 5%;">&nbsp;</div>
            <div class="color-segment" style="width: 15%;">&nbsp;</div>
            <div class="color-segment" style="width: 5%;">&nbsp;</div>
            <div class="color-segment" style="width: 15%;">&nbsp;</div>
            <div class="color-segment" style="width: 5%;">&nbsp;</div>
            <div class="Barcountbox">
               <h2 class="DemBarcount">211</h2>
               <h2 class="RepBarcount">220</h2>
            </div>
         </div>
         <div class="resultcenterline"></div>
      </div>

      <div class="box modelpickerbox">
         <h2 class="optiontext">Model</h2>
         <hr>
         <button class="ElectionType" id="2024 Model">
            <p class="buttontext">2024</p>
         </button>

         <h2 class="optiontext">Actual Results</h2>
         <hr>
         <button class="ElectionType" id="Incumbents">
            <p class="buttontext">Incumbents</p>
         </button>
         <button class="ElectionType" id="2022 Actual Results">
            <p class="buttontext">House 2022</p>
         </button>
         <button class="ElectionType" id="2020 President Actual Results">
            <p class="buttontext">Pres. 2020</p>
         </button>
         <button class="ElectionType" id="2016 President Actual Results">
            <p class="buttontext">Pres. 2016</p>
         </button>
         <button class="ElectionType" id="2012 President Actual Results">
            <p class="buttontext">Pres. 2012</p>
         </button>
      </div>

      <div class="box optionsbox">
         <h2 class="optiontext">Options</h2>
         <hr>
         <div class="box">
            <div class="tooltip">
               <select id="stateDropDown">
                  <!-- Options will be populated here -->
               </select>
               <span class="tooltiptext">Select a district on the list, or click on the map!</span>
            </div>
            <br>

            <h2>Call District for:</h2>
            <button class="statecall" id="callButtonR" style="background-color: rgb(125, 51, 49);">
               <p class="buttontext">Republicans</p>
            </button>
            <button class="statecall" id="callButtonD" style="background-color: rgb(49, 50, 125);">
               <p class="buttontext">Democrats</p>
            </button>

            <hr>

            <!-- Number input field -->
            <label>Enter a number between 0 and 100 (Dem win %)</label>
            <br>
            <input type="number" id="numberInput" name="numberInput" min="0" max="1100" step="1">

            <button class="enter" id="enterButton">
               <p class="buttontext">Enter</p>
            </button>
            <br>
            <input type="range" min="1" max="100" value="50" class="slider" id="sliderInput" name="numberInput">
         </div>

         <br>

         <!--Percent Democrats win-->
         <label for="chanceOfDWinState">
            <h2>Chance of Democratic Win:</h2>
         </label>
         <span class="buttontext" id="chanceOfDWinState">0</span>

         <!--Projected Seats-->
         <label for="projectedSeatsD">
            <h2>Projected Democrat Seats:</h2>
         </label>
         <span class="buttontext" id="projectedSeatsD">0</span>

         
         <h2 class="optiontext">Site Settings</h2>
         <hr>

         <div class="site-settings">
            <form autocomplete='false'>
            <label class="switch">
                <input type="checkbox" id="background-flat">
                <span class="slidertoggle"></span>
            </label>
            <p class="siteoptiontext">Flat Background</p>
            <br>
            <label class="switch moblay">
                <input type="checkbox" id="mobile-layout-toggle">
                <span class="slidertoggle"></span>
            </label>
            <p class="siteoptiontext moblay">Mobile Layout</p>
            <br>
            <label class="switch">
                <input type="checkbox" id="random-color-teams">
                <span class="slidertoggle"></span>
            </label>
            <p class="siteoptiontext">Randomize Colors</p>
            <br>
            <button type="button" id="change-hue-btn" style="display: none;"><p class="buttontext">Change Hue</p></button>
        </form>
        </div>
      </div>

      <div class="box mapviewbox">
         <div class="buttonbox">
            <button class="ZoomButton" id="Zoomin">
               <h1>+</h1>
            </button>
            <button class="ZoomButton" id="Zoomout">
               <h1>-</h1>
            </button>
            <button class="ZoomButton" id="Resetview" style="transform: translateY(5px);">
               <h1>â†ª</h1>
            </button>
         </div>
